import './items-list.css';

function ItemList() {
  return (
    <div className="item-list">
      <div className="titles">
        <h1>Item</h1>
        <h1>Price</h1>
        <h1>Quantity</h1>
      </div>
      <div className="new-item">
        <h1>Apple</h1>
      </div>
    </div>
  );
}

export default ItemList;
